    class JsonOutputTest
    {
        public dynamic JsonObjectOutputTest()
        {
            //strong type instance
            var jsonObject = new JObject();

            //you can exiplicitly add values here using class interface
            jsonObject.Add("Date",DateTime.Now);

            // or cast to dynamic to dynamically add/read properites
            dynamic album = jsonObject;

            album.AlbumName = "Dirty Deeds Done Dirt Cheap";
            album.Artist = "AC/DC";
            album.YearRelease = 1976;

            album.Songs = new JArray();

            dynamic song = new JObject();
            song.SongName = "Dirty Deeds Done dirt cheap";
            song.SongLength = "4:11";
            album.Songs.Add(song);

            song = new JObject();
            song.SongName = "Love at First Feel";
            song.SongLength = "3:10";
            album.Songs.Add(song);

            Console.WriteLine( album.ToString());
            Console.WriteLine("------------------");
            return album;
        }

        public void IterateOverJsonObject(JObject jObject)
        {
            foreach (var item in jObject)
            {
                if (! (item.Value.GetType() == typeof (JArray)))
                {
                    Console.WriteLine(" - " + item.Key + " " + item.Value);                        
                }
                else
                {
                    try
                    {
                        Console.WriteLine("\n -- Album Songs");
                        var songs = JArray.Parse(item.Value.ToString());
                        if (songs == null) throw new ArgumentNullException("songs");
                        foreach (JObject content in songs.Children<JObject>())
                        {
                            foreach (JProperty prop in content.Properties())
                            {
                                Console.WriteLine("\t -"+prop.Name + " => "+ prop.Value);
                            }
                        }
                    }
                    catch (Exception Ex)
                    {
                        Console.WriteLine("error in parsing Json Array" + " -err msg: " + Ex.Message);
                    }
                }
            }
        }
        public void JValueParsingTest()
        {
            var jsonString = @"{""Name"":""Rick"",""Company"":""West Wind"",
                        ""Entered"":""2012-03-16T00:03:33.245-10:00""}";

            dynamic json = JValue.Parse(jsonString);

            // values require casting
            string name = json.Name;
            string company = json.Company;
            DateTime entered = json.Entered;

            Assert.AreEqual(name, "Rick");
            Assert.AreEqual(company, "West Wind");
        }

        
